import './App.css';
import Chart from 'chart.js/auto';

//let os = document.getElementById('os');
//let browser = document.getElementById('browser');
let type = document.getElementById('type');
//let n1 = document.getElementById('n1');
//let n2 = document.getElementById('n2');

function App() {
  return (
    <div className="App">
    <div class="title has-grey-background"><h1>Igor's Challenge</h1></div>
    <div>
      <select id="type" placeholder="select type">
        <option value="start">Start</option>
        <option value="stop">Stop</option>
      </select>
</div>
    <div><input id="os" className="invisible" type="select" placeholder="select os" /><input id="browser" className="invisible" type="select" placeholder="select browser" /></div>
    <div><input id="n1" className="invisible" type="number"  placeholder="give a value"/><input id="n2" className="invisible" type="number"  placeholder="give a value"/></div>
    <div><input onClick={checkInputs()} type="submit" /></div>
    <div><canvas id="mychart"></canvas></div>
    </div>
  );
}

function checkInputs() {
  let data = [];

  if(!checkEmpty(type)) {
    if(checkEmptyString(type.value)) {
      data.push(handleStart());
    }

  }
}

function checkEmpty(val) {
  return val === null || val === undefined;
}

function checkEmptyString(val) {
  return val === '';
}

function handleStart() {
  return {type: 'start', timestamp: Date.now(), select: ['min_response_time', 'max_response_time'], group: ['os', 'browser']};
}

// eslint-disable-next-line
function handleSpan(initDate, endDate) {
  return {type: 'span', timestamp: Date.now(), begin: initDate, end: endDate};
}

// eslint-disable-next-line
function handleData(time, os, browser, n1, n2) {
  return {type: 'data', timestamp: time, os: os, browser: browser, min_response_time: n1, max_response_time: n2};
}

// eslint-disable-next-line
function handleStop() {
  return {type: 'stop', timestamp: Date.now()};
}

// eslint-disable-next-line
function drawChart(obj){
  const ctx = document.getElementById('mychart');

  new Chart(ctx, {
    type: 'line',
    data: {
      datasets: [{
        abel: 'My First Dataset',
        data: [//{type: 'start', timestamp: 1519780251293, select: ['min_response_time', 'max_response_time'], group: ['os', 'browser']},
        //{type: 'span', timestamp: 1519780251293, begin: 1519780251001, end: 1519780251002},
        {type: 'data', timestamp: 1519780251001, os: 'linux', browser: 'chrome', min_response_time: 0.1, max_response_time: 1.3},
        {type: 'data', timestamp: 1519780251001, os: 'linux', browser: 'firefox', min_response_time: 0.1, max_response_time: 1.2},
        {type: 'data', timestamp: 1519780251001, os: 'mac', browser: 'chrome', min_response_time: 0.2, max_response_time: 1.6},
        {type: 'data', timestamp: 1519780251001, os: 'mac', browser: 'firefox', min_response_time: 0.3, max_response_time: 1.4},
        {type: 'data', timestamp: 1519780251002, os: 'linux', browser: 'chrome', min_response_time: 0.2, max_response_time: 1.4},
        {type: 'data', timestamp: 1519780251002, os: 'linux', browser: 'firefox', min_response_time: 0.3, max_response_time: 1.2},
        {type: 'data', timestamp: 1519780251002, os: 'mac', browser: 'chrome', min_response_time: 0.4, max_response_time: 1.8},
        {type: 'data', timestamp: 1519780251002, os: 'mac', browser: 'firefox', min_response_time: 0.5, max_response_time: 1.7},
        /*{type: 'stop', timestamp: 1529780251293}*/],
        fill: false,
        borderColor: 'rgb(75, 192, 192)',
        tension: 0.1
      }]
    },
    height: 400,
    width: 600,
    options: {
      scales: {
        y: {
          beginAtZero: true
        }
      },
      maintainAspectRatio: false,
      responsive: true,
      plugins: {
          legend: {
              display: false
          }
      }
    }
  });
}

export default App;
